import { combineReducers } from 'redux';
import tasks from './tasks';
import isDisplayForm from './isDisplayForm'

const myReducer = combineReducers({
    tasks:tasks, // tasks -- ES6
    isDisplayForm:isDisplayForm 
});

export default myReducer;
